{
  "translationLines": [
    {
      "lineNumber": 188152,
      "originalJapaneseLine": "　トドメを刺すために来てくれたのですよね？」",
      "translatedEnglishLine": "You came to deliver the finishing blow, didn't you?"
    },
    {
      "lineNumber": 188153,
      "originalJapaneseLine": "「がははは、そうだ。",
      "translatedEnglishLine": "\"Gahahaha, that's right."
    },
    {
      "lineNumber": 188154,
      "originalJapaneseLine": "　任せておけ」",
      "translatedEnglishLine": "Leave it to me.\""
    },
    {
      "lineNumber": 188155,
      "originalJapaneseLine": "「というわけで早くそこを通せ」",
      "translatedEnglishLine": "\"So then, let us through quickly.\""
    },
    {
      "lineNumber": 188156,
      "originalJapaneseLine": "「はい、お任せします」",
      "translatedEnglishLine": "\"Yes, leave it to us.\""
    },
    {
      "lineNumber": 188157,
      "originalJapaneseLine": "（ふん、相変わらずちょろい奴。",
      "translatedEnglishLine": "(Hmph, as always, an easy target."
    },
    {
      "lineNumber": 188158,
      "originalJapaneseLine": "　この辺はまだまだだな）",
      "translatedEnglishLine": "This area still has a long way to go.)"
    },
    {
      "lineNumber": 188159,
      "originalJapaneseLine": "（嘘は良くないですよぉ、ランス様……）",
      "translatedEnglishLine": "(Lying isn't good, you know, Lord Rance...)"
    },
    {
      "lineNumber": 188160,
      "originalJapaneseLine": "「それでは僕達は念のため、",
      "translatedEnglishLine": "\"Well then, just to be safe,"
    },
    {
      "lineNumber": 188161,
      "originalJapaneseLine": "　この辺りの見回りを行います。",
      "translatedEnglishLine": "we will patrol around this area."
    },
    {
      "lineNumber": 188162,
      "originalJapaneseLine": "　皆さん、どうかお気をつけて」",
      "translatedEnglishLine": "Everyone, please be careful.\""
    },
    {
      "lineNumber": 188163,
      "originalJapaneseLine": "「おーう」",
      "translatedEnglishLine": "\"Alright!\""
    },
    {
      "lineNumber": 188164,
      "originalJapaneseLine": "アレックスはランス達を見送ってから、",
      "translatedEnglishLine": "After seeing off Rance and the others,"
    },
    {
      "lineNumber": 188165,
      "originalJapaneseLine": "一度息を吐いた。",
      "translatedEnglishLine": "Alex let out a breath."
    },
    {
      "lineNumber": 188166,
      "originalJapaneseLine": "「皆、それじゃあ、一時休憩とする。",
      "translatedEnglishLine": "\"Everyone, then, let's take a short break."
    },
    {
      "lineNumber": 188167,
      "originalJapaneseLine": "　その後、引き続き見回りを頑張ろう」",
      "translatedEnglishLine": "After that, let's continue the patrol."
    },
    {
      "lineNumber": 188168,
      "originalJapaneseLine": "「はいっ！」",
      "translatedEnglishLine": "\"Yes!\""
    },
    {
      "lineNumber": 188169,
      "originalJapaneseLine": "「了解です！」",
      "translatedEnglishLine": "\"Understood!\""
    },
    {
      "lineNumber": 188170,
      "originalJapaneseLine": "アレックスの部隊の面々が",
      "translatedEnglishLine": "The members of Alex's unit"
    },
    {
      "lineNumber": 188171,
      "originalJapaneseLine": "思い思いの場所に腰を下ろす。",
      "translatedEnglishLine": "sat down in places of their choosing."
    },
    {
      "lineNumber": 188172,
      "originalJapaneseLine": "そのとき、アレックスの持つ",
      "translatedEnglishLine": "At that moment, on Alex's"
    },
    {
      "lineNumber": 188173,
      "originalJapaneseLine": "魔法電話に連絡が入った。",
      "translatedEnglishLine": "magic phone, a call came through."
    },
    {
      "lineNumber": 188174,
      "originalJapaneseLine": "「？　はい、もしもし？」",
      "translatedEnglishLine": "\"? Yes, hello?\""
    },
    {
      "lineNumber": 188175,
      "originalJapaneseLine": "「あ、あなた〜？」",
      "translatedEnglishLine": "\"Ah, you~?\""
    },
    {
      "lineNumber": 188176,
      "originalJapaneseLine": "受話器の向こうから、",
      "translatedEnglishLine": "From the other end of the receiver,"
    },
    {
      "lineNumber": 188177,
      "originalJapaneseLine": "の〜んびりとした声がの〜んびりと届く。",
      "translatedEnglishLine": "a very relaxed voice leisurely reached him."
    },
    {
      "lineNumber": 188178,
      "originalJapaneseLine": "「あ……エロピチャか」",
      "translatedEnglishLine": "\"Ah... Eropicha.\""
    },
    {
      "lineNumber": 188179,
      "originalJapaneseLine": "「そこは〜、エロピチャじゃなくて〜、",
      "translatedEnglishLine": "\"That's where you should say~ not Eropicha, but~"
    },
    {
      "lineNumber": 188180,
      "originalJapaneseLine": "　お前〜、って言ってくれないと〜……」",
      "translatedEnglishLine": "you should say 'you~' instead...\""
    },
    {
      "lineNumber": 188181,
      "originalJapaneseLine": "「う、うん……",
      "translatedEnglishLine": "\"Y-yeah..."
    },
    {
      "lineNumber": 188182,
      "originalJapaneseLine": "　いや、ごめん、まだ慣れなくて……」",
      "translatedEnglishLine": "No, sorry, I'm still not used to it...\""
    },
    {
      "lineNumber": 188183,
      "originalJapaneseLine": "「うふふ〜……」",
      "translatedEnglishLine": "\"Ufufu~...\""
    },
    {
      "lineNumber": 188184,
      "originalJapaneseLine": "「突然電話してごめんなさい〜。",
      "translatedEnglishLine": "\"Sorry to call you so suddenly~."
    },
    {
      "lineNumber": 188185,
      "originalJapaneseLine": "　どうしてもあなたの声が聞きたくて〜」",
      "translatedEnglishLine": "I just really wanted to hear your voice~.\""
    },
    {
      "lineNumber": 188186,
      "originalJapaneseLine": "「本当は私用に使ったら",
      "translatedEnglishLine": "\"Actually, I thought"
    },
    {
      "lineNumber": 188187,
      "originalJapaneseLine": "　いけないと思ったんだけど〜……」",
      "translatedEnglishLine": "I shouldn't use it for personal reasons~...\""
    },
    {
      "lineNumber": 188188,
      "originalJapaneseLine": "「ああ、そうだね。",
      "translatedEnglishLine": "\"Ah, that's right."
    },
    {
      "lineNumber": 188189,
      "originalJapaneseLine": "　仕事中に電話しないようにと",
      "translatedEnglishLine": "I told you before not to call during work,"
    },
    {
      "lineNumber": 188190,
      "originalJapaneseLine": "　前から言っておいた筈だよ」",
      "translatedEnglishLine": "I'm sure I said that before.\""
    },
    {
      "lineNumber": 188191,
      "originalJapaneseLine": "「いや……でも、その言い方は卑怯かな……」",
      "translatedEnglishLine": "\"No... but that way of saying it feels a bit unfair...\""
    },
    {
      "lineNumber": 188192,
      "originalJapaneseLine": "「ありがとう、君の声を聞いたら、",
      "translatedEnglishLine": "\"Thank you, hearing your voice"
    },
    {
      "lineNumber": 188193,
      "originalJapaneseLine": "　また仕事頑張ろうって気になった」",
      "translatedEnglishLine": "made me want to work hard again.\""
    },
    {
      "lineNumber": 188194,
      "originalJapaneseLine": "「……本当はその為に電話してくれたんだろう？」",
      "translatedEnglishLine": "\"...You really called me just for that, didn't you?\""
    },
    {
      "lineNumber": 188195,
      "originalJapaneseLine": "「うふふ〜、奥さんを買いかぶりすぎ〜」",
      "translatedEnglishLine": "\"Ufufu~, you overestimate your wife~\""
    },
    {
      "lineNumber": 188196,
      "originalJapaneseLine": "「お、奥さんって……",
      "translatedEnglishLine": "\"W-Wife... but..."
    },
    {
      "lineNumber": 188197,
      "originalJapaneseLine": "　まだ婚約しただけなのに……",
      "translatedEnglishLine": "We're only engaged still..."
    },
    {
      "lineNumber": 188198,
      "originalJapaneseLine": "　はは、なんだか照れ臭いな……」",
      "translatedEnglishLine": "Haha, it feels kind of embarrassing...\""
    },
    {
      "lineNumber": 188199,
      "originalJapaneseLine": "「約束は出来ないけど、",
      "translatedEnglishLine": "\"I can't promise,"
    },
    {
      "lineNumber": 188200,
      "originalJapaneseLine": "　三日後には帰れると思う。",
      "translatedEnglishLine": "but I think I'll be able to come back in three days."
    },
    {
      "lineNumber": 188201,
      "originalJapaneseLine": "　それまで元気で」",
      "translatedEnglishLine": "Until then, stay well.\""
    },
    {
      "lineNumber": 188202,
      "originalJapaneseLine": "「美味しいもの用意して待ってるわ〜」",
      "translatedEnglishLine": "\"I'll prepare something delicious and wait for you~\""
    },
    {
      "lineNumber": 188203,
      "originalJapaneseLine": "短い会話を終えて、アレックスが受話器を置く。",
      "translatedEnglishLine": "After the short conversation, Alex hung up the receiver."
    },
    {
      "lineNumber": 188204,
      "originalJapaneseLine": "（帰るときには何か……お土産買ってから……",
      "translatedEnglishLine": "(When I return... maybe I'll buy some souvenirs first..."
    },
    {
      "lineNumber": 188205,
      "originalJapaneseLine": "　指輪は前回買ったから……ネックレスとか……）",
      "translatedEnglishLine": "I already bought a ring last time... maybe a necklace or something...)"
    },
    {
      "lineNumber": 188206,
      "originalJapaneseLine": "（ご時世を考えると不謹慎な気もするけど……",
      "translatedEnglishLine": "(Considering the times, it might feel inappropriate..."
    },
    {
      "lineNumber": 188207,
      "originalJapaneseLine": "　うん、それくらいは……いい、よね……）",
      "translatedEnglishLine": "Yeah, that much should be... okay, right...)"
    },
    {
      "lineNumber": 188208,
      "originalJapaneseLine": "「よしっ！」",
      "translatedEnglishLine": "\"Alright!\""
    },
    {
      "lineNumber": 188209,
      "originalJapaneseLine": "ぱしっとアレックスは自身の頬を両手で叩いた。",
      "translatedEnglishLine": "Alex slapped both his cheeks with his hands."
    },
    {
      "lineNumber": 188210,
      "originalJapaneseLine": "「休憩終わり。",
      "translatedEnglishLine": "\"Break's over."
    },
    {
      "lineNumber": 188211,
      "originalJapaneseLine": "　みんなもう一頑張り、頼んだよ」",
      "translatedEnglishLine": "Everyone, let's give it one more push, alright?\""
    }
  ]
}

